import React from 'react'
import {Typography, Avatar, Grid, Box } from '@material-ui/core'
import avatar from '../bryan.png'

const Header = () => {
  return (
    <Box>
      <Avatar src={avatar} alt="Bryan Roof"/>    
    </Box>
  );
};

export default Header
